import org.apache.bcel.generic.Type;
import org.apache.bcel.util.SyntheticRepository;
import org.junit.jupiter.api.Test;

public class ClassCircularityErrorTest {

    private byte[] createClassBytecode(final String className, final String superClassName) {
        final ClassGen classGen = new ClassGen(className, superClassName, "<generated>", Const.ACC_PUBLIC, null);
        final ConstantPoolGen constantPoolGen = classGen.getConstantPool();
        final InstructionList instructionList = new InstructionList();
        final InstructionFactory factory = new InstructionFactory(classGen, constantPoolGen);
        final MethodGen methodGen = new MethodGen(Const.ACC_PUBLIC, Type.VOID, Type.NO_ARGS, new String[0], "<init>",
                className, instructionList, constantPoolGen);

        instructionList.append(InstructionFactory.createLoad(Type.OBJECT, 0));
        instructionList.append(factory.createInvoke(superClassName, "<init>", Type.VOID, Type.NO_ARGS, Const.INVOKESPECIAL));
        instructionList.append(InstructionFactory.createReturn(Type.VOID));
        methodGen.setMaxStack();
        methodGen.setMaxLocals();
        classGen.addMethod(methodGen.getMethod());
        instructionList.dispose();
        return classGen.getJavaClass().getBytes();
    }

    private byte[] createInterfaceBytecode(final String interfaceName, final String... superInterfaceNames) {
        final ClassGen classGen = new ClassGen(interfaceName, "java.lang.Object", "<generated>",
                Const.ACC_PUBLIC | Const.ACC_INTERFACE, superInterfaceNames);
        return classGen.getJavaClass().getBytes();
    }

    @Test
    public void testFindFieldCircularInheritance() throws ClassNotFoundException, IOException {
        final byte[] cyclicClassABytecode = createClassBytecode("CyclicClassA", "CyclicClassB");
        final byte[] cyclicClassBBytecode = createInterfaceBytecode("CyclicClassB", "CyclicClassA");
        final byte[] cyclicTestClassBytecode = createClassBytecode("CyclicTestClass", "CyclicClassA");

        final ClassParser classAParser = new ClassParser(new ByteArrayInputStream(cyclicClassABytecode), "CyclicClassA.class");
        final JavaClass cyclicClassA = classAParser.parse();

        final ClassParser classBParser = new ClassParser(new ByteArrayInputStream(cyclicClassBBytecode), "CyclicClassB.class");
        final JavaClass cyclicClassB = classBParser.parse();

        final ClassParser testClassParser = new ClassParser(new ByteArrayInputStream(cyclicTestClassBytecode), "CyclicTestClass.class");
        final JavaClass cyclicTestClass = testClassParser.parse();

        final SyntheticRepository repository = SyntheticRepository.getInstance();
        repository.storeClass(cyclicClassA);
        repository.storeClass(cyclicClassB);
        repository.storeClass(cyclicTestClass);

        Repository.setRepository(repository);

        try {
            assertThrows(ClassCircularityError.class, () -> cyclicTestClass.findField("nonExistentField", Type.INT));
        } finally {
            repository.removeClass(cyclicClassA);
            repository.removeClass(cyclicClassB);
            repository.removeClass(cyclicTestClass);
        }
    }
}

