package org.apache.bcel;

import org.apache.bcel.generic.ClassGen;
import org.apache.bcel.util.ClassPath;
import org.apache.bcel.util.SyntheticRepository;
import org.junit.jupiter.api.Test;

import java.io.File;
import java.io.IOException;
import java.nio.file.FileVisitResult;
import java.nio.file.Files;
import java.nio.file.Path;
import java.nio.file.SimpleFileVisitor;
import java.nio.file.attribute.BasicFileAttributes;

import static org.junit.jupiter.api.Assertions.assertThrows;

public class BcelCircularDependencyTest {

    @Test
    public void testCircularDependency() throws IOException {
        Path temp_directory = null;
        try {
            // Step 0: Create a temporary working directory
            temp_directory = Files.createTempDirectory("bcel-test");

            // Step 1: Create a class definition for a first class that extends a second class
            ClassGen contract1Gen = new ClassGen("Contract1", "Contract2", "Contract1.java", Const.ACC_PUBLIC, new String[]{});
            contract1Gen.addEmptyConstructor(Const.ACC_PUBLIC);
            Files.write(temp_directory.resolve("Contract1.class"), contract1Gen.getJavaClass().getBytes());

            // Step 2: Create a class definition for a second class that extends the first class, forming a cycle
            ClassGen contract2Gen = new ClassGen("Contract2", "Contract1", "Contract2.java", Const.ACC_PUBLIC, new String[]{});
            contract2Gen.addEmptyConstructor(Const.ACC_PUBLIC);
            Files.write(temp_directory.resolve("Contract2.class"), contract2Gen.getJavaClass().getBytes());

            // Step 3: Create a class definition for a concrete implementation that extends the first class
            ClassGen implGen = new ClassGen("Implementation", "Contract1", "Implementation.java", Const.ACC_PUBLIC, new String[]{});
            implGen.addEmptyConstructor(Const.ACC_PUBLIC);
            Files.write(temp_directory.resolve("Implementation.class"), implGen.getJavaClass().getBytes());

            // Step 4: Configure the type resolution path to include the temporary directory and standard system locations
            final SyntheticRepository resolution_path_config = SyntheticRepository.getInstance(new ClassPath(ClassPath.getClassPath() + File.pathSeparator + temp_directory.toString()));

            // Step 5: Attempt to verify the class hierarchy and assert that a circular dependency error is raised
            assertThrows(ClassCircularityError.class, () -> {
                Repository.setRepository(resolution_path_config);
                Repository.getSuperClasses("Implementation");
            });

        } finally {
            // Step 6: Delete the temporary working directory
            if (temp_directory != null) {
                Files.walkFileTree(temp_directory, new SimpleFileVisitor<Path>() {
                    @Override
                    public FileVisitResult visitFile(Path file, BasicFileAttributes attrs) throws IOException {
                        Files.delete(file);
                        return FileVisitResult.CONTINUE;
                    }

                    @Override
                    public FileVisitResult postVisitDirectory(Path dir, IOException exc) throws IOException {
                        Files.delete(dir);
                        return FileVisitResult.CONTINUE;
                    }
                });
            }
        }
    }
}

