public class JavaClassCircularIT {

    private static final String INTERFACE1_NAME = "TestInterface1";
    private static final String INTERFACE2_NAME = "TestInterface2";
    private static final String CLASS_NAME = "TestClass";

    private byte[] createInterface1Bytecode() {
        final ClassGen cg = new ClassGen(INTERFACE1_NAME, "java.lang.Object", "<generated>", Const.ACC_PUBLIC | Const.ACC_INTERFACE, new String[] { INTERFACE2_NAME });
        final ConstantPoolGen cp = cg.getConstantPool();
        final InstructionList il = new InstructionList();
        final MethodGen mg = new MethodGen(Const.ACC_PUBLIC | Const.ACC_ABSTRACT, Type.VOID, Type.NO_ARGS, new String[0], "someMethod", INTERFACE1_NAME, il, cp);
        cg.addMethod(mg.getMethod());
        return cg.getJavaClass().getBytes();
    }

    private byte[] createInterface2Bytecode() {
        final ClassGen cg = new ClassGen(INTERFACE2_NAME, "java.lang.Object", "<generated>", Const.ACC_PUBLIC | Const.ACC_INTERFACE, new String[] { INTERFACE1_NAME });
        final ConstantPoolGen cp = cg.getConstantPool();
        final InstructionList il = new InstructionList();
        final MethodGen mg = new MethodGen(Const.ACC_PUBLIC | Const.ACC_ABSTRACT, Type.VOID, Type.NO_ARGS, new String[0], "someMethod", INTERFACE2_NAME, il, cp);
        cg.addMethod(mg.getMethod());
        return cg.getJavaClass().getBytes();
    }

    private byte[] createClassBytecode() {
        final ClassGen cg = new ClassGen(CLASS_NAME, "java.lang.Object", "<generated>", Const.ACC_PUBLIC, new String[] { INTERFACE1_NAME });
        final ConstantPoolGen cp = cg.getConstantPool();
        final InstructionList il = new InstructionList();
        final MethodGen mg = new MethodGen(Const.ACC_PUBLIC, Type.VOID, Type.NO_ARGS, new String[0], "someMethod", CLASS_NAME, il, cp);
        il.append(new RETURN());
        mg.setMaxStack();
        mg.setMaxLocals();
        cg.addMethod(mg.getMethod());
        return cg.getJavaClass().getBytes();
    }

    @Test
    public void testFindFieldCircular() throws IOException, ClassNotFoundException {
        final byte[] interface1Bytecode = createInterface1Bytecode();
        final byte[] interface2Bytecode = createInterface2Bytecode();
        final byte[] classBytecode = createClassBytecode();

        final ClassParser interface1Parser = new ClassParser(new ByteArrayInputStream(interface1Bytecode), INTERFACE1_NAME);
        final JavaClass interface1JavaClass = interface1Parser.parse();

        final ClassParser interface2Parser = new ClassParser(new ByteArrayInputStream(interface2Bytecode), INTERFACE2_NAME);
        final JavaClass interface2JavaClass = interface2Parser.parse();

        final ClassParser classParser = new ClassParser(new ByteArrayInputStream(classBytecode), CLASS_NAME);
        final JavaClass classJavaClass = classParser.parse();

        final SyntheticRepository syntheticRepository = SyntheticRepository.getInstance();

        JavaClass loadedInterface1 = null;
        JavaClass loadedInterface2 = null;
        JavaClass loadedClass = null;

        try {
            syntheticRepository.storeClass(interface1JavaClass);
            loadedInterface1 = syntheticRepository.loadClass(INTERFACE1_NAME);

            syntheticRepository.storeClass(interface2JavaClass);
            loadedInterface2 = syntheticRepository.loadClass(INTERFACE2_NAME);

            syntheticRepository.storeClass(classJavaClass);
            loadedClass = syntheticRepository.loadClass(CLASS_NAME);

            Repository.setRepository(syntheticRepository);

            final JavaClass finalLoadedClass = loadedClass;
            assertThrows(ClassCircularityError.class, () -> finalLoadedClass.findField("nonExistentField", Type.INT));
        } finally {
            if (loadedInterface1 != null) {
                syntheticRepository.removeClass(loadedInterface1);
            }
            if (loadedInterface2 != null) {
                syntheticRepository.removeClass(loadedInterface2);
            }
            if (loadedClass != null) {
                syntheticRepository.removeClass(loadedClass);
            }
        }
    }
}

