import org.junit.jupiter.api.Test;

public class CircularInheritanceTest {

    @Test
    public void testCircularInheritanceRejection() {
        ClassGen firstContractDefinition = new ClassGen(
                "com.example.FirstContract",
                "com.example.SecondContract",
                "FirstContract.java",
                Const.ACC_PUBLIC, // A class, not an interface
                new String[0]
        );

        ClassGen secondContractDefinition = new ClassGen(
                "com.example.SecondContract",
                "com.example.FirstContract",
                "SecondContract.java",
                Const.ACC_PUBLIC, // A class, not an interface
                new String[0]
        );

        ClassGen concreteImplementationDefinition = new ClassGen(
                "com.example.ConcreteImplementation",
                "com.example.FirstContract", // Extends the class
                "ConcreteImplementation.java",
                Const.ACC_PUBLIC,
                new String[0]
        );

        try {
            Repository.addClass(firstContractDefinition.getJavaClass());
            Repository.addClass(secondContractDefinition.getJavaClass());
            Repository.addClass(concreteImplementationDefinition.getJavaClass());

